// SignOut.js


import React from 'react';

const LogIn = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '20px' }}>
      {/* Left side div with lorem ipsum */}
      <div style={{ flex: '1', paddingRight: '20px', fontSize: '18px' }}> {/* Adjust font size */}
        <center><h2 style={{ fontSize: '24px' }}>Budget Brain Tips on Saving!</h2></center>{/* Adjust font size */}
        <p>
          <li style={{font:"bold"}}>Set Clear Goals: Start by defining your financial goals, whether it's saving for a vacation, paying off debt, or building an emergency fund. Having specific objectives will give your budgeting efforts purpose and motivation.</li>

          <li>Create a Realistic Budget: Design a budget that aligns with your income and financial goals. Be realistic about your expenses and allocate funds accordingly to necessities, savings, and discretionary spending.</li>

          <li>Review and Adjust Regularly: Regularly review your budget to ensure it's still aligned with your financial goals and lifestyle. Adjustments may be necessary as your income or expenses change over time.</li>
          <li>Stay Disciplined: Stick to your budgeting plan even when faced with temptation or unexpected challenges. Practice self-discipline and remind yourself of your financial goals to stay motivated.</li>
          <li>Celebrate Milestones: Celebrate small victories along the way to keep yourself motivated and engaged with your budgeting efforts. Whether it's reaching a savings goal or paying off a debt, acknowledging your progress can boost morale and encourage continued consistency.</li>
          <li>Stay Disciplined: Stick to your budgeting plan even when faced with temptation or unexpected challenges. Practice self-discipline and remind yourself of your financial goals to stay motivated.</li>
        </p>
      </div>

      {/* Right side login screen */}
      <div style={{ flex: '1', paddingLeft: '20px' }}>
        <center>
          <div style={{ fontSize: '16px' }}> {/* Adjust font size */}
            <h2 style={{ fontSize: '20px' }}>Log In Page</h2> {/* Adjust font size */}
            <p style={{ fontSize: '14px' }}>Log in to access your account.</p> {/* Adjust font size */}

            <input type="text" id="username" name="uname" placeholder='Enter your Username'></input><br></br>
            <input type="text" id="password" name="pswd" placeholder='Enter your Password'></input><br></br>

            <a href="/about"><button type="submit">Login</button></a>
            <a href="/signin"><button type="submit">Don't have an account? Signup!</button></a>
          </div>
        </center>
      </div>
    </div>
  );
};

export default LogIn;
